import { Icon } from '@iconify/react';
import plusFill from '@iconify/icons-eva/plus-fill';
import { Link as RouterLink } from 'react-router-dom';
// material
import {
  Grid,
  Button,
  Container,
  Stack,
  Typography,
  Slider,
  Divider,
  FormGroup,
  FormControlLabel,
  Switch
} from '@mui/material';
// components
import Page from '../components/Page';
//

// ----------------------------------------------------------------------

const marks = [
  {
    value: 0,
    label: '0%'
  },
  {
    value: 20,
    label: '20%'
  },
  {
    value: 40,
    label: '40%'
  },
  {
    value: 60,
    label: '60%'
  },
  {
    value: 80,
    label: '80%'
  },
  {
    value: 100,
    label: '100%'
  }
];

// ----------------------------------------------------------------------

export default function Settings() {
  return (
    <Page title="Dashboard: Settings">
      <Container maxWidth="xl">
        <Stack direction="row" alignItems="center" justifyContent="space-between" mb={5}>
          <Typography variant="h4" gutterBottom style={{ color: '#66fcf1' }}>
            Settings
          </Typography>
        </Stack>
        <Container maxWidth="xl">
          <Grid>
            <Divider>
              <Typography variant="h5" gutterBottom style={{ color: '#66fcf1' }}>
                Speed Settings
              </Typography>
            </Divider>

            <Grid container spacing={{ xs: 10 }} columns={{ xs: 8, sm: 8, md: 8, lg: 8 }}>
              <Grid item xs={2}>
                <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                  Robot Foward Speed
                </Typography>
                <Slider
                  defaultValue={50}
                  step={10}
                  min={0}
                  max={100}
                  marks={marks}
                  color="primary"
                />
              </Grid>
              <Grid item xs={2}>
                <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                  Robot Backwards Speed
                </Typography>
                <Slider
                  defaultValue={50}
                  step={10}
                  min={0}
                  max={100}
                  marks={marks}
                  color="primary"
                />
              </Grid>
              <Grid item xs={2}>
                <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                  Robot Turning Speed
                </Typography>
                <Slider
                  defaultValue={50}
                  step={10}
                  min={0}
                  max={100}
                  marks={marks}
                  color="primary"
                />
              </Grid>
              <Grid item xs={2}>
                <Typography variant="h6" gutterBottom style={{ color: '#45a29e' }}>
                  Robot Seed
                </Typography>
                <Slider
                  defaultValue={50}
                  step={10}
                  min={0}
                  max={100}
                  marks={marks}
                  color="primary"
                />
              </Grid>
            </Grid>
          </Grid>
          <Grid>
            <Divider>
              <Typography variant="h5" gutterBottom style={{ color: '#66fcf1' }}>
                Lights & Leds
              </Typography>
            </Divider>
            <Grid container spacing={{ xs: 10 }} columns={{ xs: 8, sm: 8, md: 8, lg: 8 }}>
              <Grid item xs={2} style={{ color: '#fff' }}>
                <FormGroup>
                  <Typography variant="h7" gutterBottom style={{ color: '#66fcf1' }}>
                    Front Lights 12V
                  </Typography>
                  <FormControlLabel control={<Switch />} label="ON" />
                </FormGroup>{' '}
              </Grid>
            </Grid>
          </Grid>
        </Container>
      </Container>
    </Page>
  );
}
